import React from 'react';
import './Footer.css';  // Archivo CSS

const Footer = () => {
  return (
    <footer className="footer-container">
      <nav>
        <ul>
          <li>about</li>
          <li>projects</li>
          <li>contact</li>
        </ul>
      </nav>
    </footer>
  );
};

export default Footer;
